import React from 'react'
import { Container } from 'react-bootstrap'

function Footer() {
  return (
  <footer style={{
        width:"100%",
        position:"relative",
        bottom: 0,
        display:"flex",
        justifyContent:"center"
  }} >
     
     <Container></Container>

  </footer>
  )
}

export default Footer
